import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Home.css';

const Home = () => {
    return (
        <div className="container-fluid">
            <div className="row">
                {/* Sol Reklam Alanı (2 grid) */}
                <div className="col-md-2 col-sm-12">
                    <div className="advertisement">
                        <h4>Reklam Alanı 1</h4>
                        {/* Reklam içeriği */}
                    </div>
                </div>

                {/* Para Birimleri (8 grid) */}
                <div className="col-md-8 col-sm-12">
                    <div className="currency-container">
                        <h4>Para Birimleri</h4>
                        <div className="row">
                            {/* Para birimi kutuları */}
                            <div className="col-md-2 col-sm-6">
                                <div className="currency-box">Para Birimi 1</div>
                            </div>
                            <div className="col-md-2 col-sm-6">
                                <div className="currency-box">Para Birimi 2</div>
                            </div>
                            <div className="col-md-2 col-sm-6">
                                <div className="currency-box">Para Birimi 3</div>
                            </div>
                            <div className="col-md-2 col-sm-6">
                                <div className="currency-box">Para Birimi 4</div>
                            </div>
                        </div>
                    </div>
                    <div className="row">
                <div className="col-md-2 col-sm-12 offset-md-10">
                    <div className="auth-section">
                        <h4>Giriş / Kayıt</h4>
                        {/* Giriş ve kayıt bileşeni buraya gelecek */}
                    </div>
                </div>
            </div>
                    {/* Para grafiği */}
                    <div className="chart-section">
                        <h4>Para Birimi Grafiği</h4>
                        {/* Grafik bileşeni buraya gelecek */}
                    </div>
                </div>

                {/* Sağ Reklam Alanı (2 grid) */}
                <div className="col-md-2 col-sm-12">
                    <div className="advertisement">
                        <h4>Reklam Alanı 2</h4>
                        {/* Reklam içeriği */}
                    </div>
                </div>
            </div>

            <div className="row">
                {/* Alt Reklam Alanı (2 grid) */}
                <div className="col-md-6 col-sm-12">
                    <div className="advertisement">
                        <h4>Reklam Alanı 3</h4>
                        {/* Reklam içeriği */}
                    </div>
                </div>
                <div className="col-md-6 col-sm-12">
                    <div className="advertisement">
                        <h4>Reklam Alanı 4</h4>
                        {/* Reklam içeriği */}
                    </div>
                </div>
            </div>

            {/* Login/Register Alanı (2 grid) */}
            
        </div>
    );
};

export default Home;
